        id: 19,
        title: 'Title 19',
        content: 'Content for item 19'
    },
    {
        id: 20,
        title: 'Title 20',
        content: 'Content for item 20'
    }
    ];

  return (
    <>
    <Grid container spacing={20}>
        { tempData.map((item) => (
        <Grid item key={item.id}>
            <Typography >  {item.title} {item.content} </Typography>
        </Grid>
        ))}
    </Grid>
    </>
  );
}

export default MainPage;
